import React from 'react';
import '../App.css';

class Order extends React.Component {

    componentDidMount() {
        const purl = "http://localhost:4000/myitem";
        fetch(purl).then(response => response.json())
        .then(json => {const cart = json.filter(cart => {
                return (cart.email===localStorage.getItem('userEmail') && cart.type==='order')
            })
            this.setState({ myCart:cart })
        })
    }

    render (){
        if(localStorage.getItem('userEmail')){
            return (
                <div class="container">
                <br></br><br></br>
                    <div class="row justify-content-center">
                        <div class="col-md-10">
                            <div class="card">
                                <div class="card-header">My Order</div>
                                <div class="card-body">
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            );
        }
    }
}

export default Order;
